import React from 'react';
import Header from './components/Header';
import Main from './components/Main';
import Sidebar from './components/Sidebar';
import Foot from './components/Foot';
import './styles/App.scss';

const App = () => {
  return (
    <div id="wrapper">
      <Header />
      <Main />
      <Sidebar />
      <Foot />
    </div>
  );
};

export default App;
